import api from './api';

const slotService = {
    getSlots: async () => {
        const response = await api.get('/slots');
        return response.data;
    },

    getAvailableSlots: async () => {
        const response = await api.get('/slots/available');
        return response.data;
    },

    createSlot: async (slotData) => {
        const response = await api.post('/slots', slotData);
        return response.data;
    },

    bookSlot: async (slotId, token) => {
        const response = await api.post('/slots/book', { slotId, token });
        return response.data;
    },

    deleteSlot: async (id) => {
    const response = await api.delete(`/slots/${id}`);
    return response.data;
  },

  deleteByDate: async (start, end) => {
  const response = await api.delete(`/slots/bulk?start=${start}&end=${end}`);
  return response.data;
}

};

export default slotService;
